import Alert from 'react-bootstrap/Alert';

function RegisterAlert(props) {
    return (
        <>
            {[
                'primary',
                'secondary',
                'success',
                'danger',
                'warning',
                'info',
                'light',
                'dark',
            ].map((variant) => (
                <Alert key={variant} variant={variant}>
                    This is a {variant} alertâ€”check it out!
                </Alert>
            ))}
        </>
    );
}

export default RegisterAlert;
